properties.DevelopmentDescription:
Alterations to the previously approved commercial/residential development comprising 18 no. apartments and 2 no. retail units in two blocks over a basement level carpark (Reg. Ref. SD03A/0576).
a)  Internal rearrangements substituting 5 no. one-bed apartments and 1 no. two-bed apartment in lieu of the 3 no. three-bed apartments as approved, to provide 21 apartments in total;
b)  Internal rearrangements converting a one-bed apartment as approved into a two-bed apartment.
c)  Minor elevational alterations associated with the above;
d)  The inclusion of additional storage areas at basement level;
e)  The temporary provision of storage and carparking for 11 no. cars at ground floor level until such time as access to the basement level carpark is made available by independent third party development on the adjoining site as approved.  These temporary spaces shall be made available by the phased completion of the 2 ground floor apartments in Block B and the rear retail unit at ground floor in Block A as approved and they shall be accessed via the existing vehicular right of way from Main Street.
